%% Se leen las funciones de forma N y P y sus derivadas dN_dxi_gl, dN_deta_gl, 
%  dP_dxi_gl, dP_deta_gl
%% Funciones de forma principales del elemento finito Table 1
%% Funciones de forma secundarias del elemento finito

Nforma = [1-xi_gl-eta_gl       % N1
          xi_gl             % N2
         eta_gl];          % N3             
dN_dxi=[ -1
          1
         0];
               
