                     0
                     1]; 
                 
Pforma = [4*(1-xi_gl-eta_gl)*xi_gl       % P1
          4*xi_gl*eta_gl              % P2
          4*(1-xi_gl-eta_gl)*eta_gl];    % P3
 
dP_dxi  =[ 4 - 8*xi_gl - 4*eta_gl
           4*eta_gl
          -4*eta_gl];    

dP_deta=[-4*xi_gl
          4*xi_gl
          4 - 4*xi_gl - 8*eta_gl];   

xe=[x1;x2;x3];
ye=[y1;y2;y3];

%% Matriz jacobiana, su inversa y determinante
% Se ensambla la matriz jacobiana
dx_dxi  = sum(dN_dxi .*xe);   dy_dxi  = sum(dN_dxi .*ye);
dx_deta = sum(dN_deta.*xe);   dy_deta = sum(dN_deta.*ye);

Je = [ dx_dxi    dy_dxi
       dx_deta   dy_deta ];
   
% y su determinante (el Jacobiano)
det_Je= det(Je);

% Se calcula su inversa
inv_Je = inv(Je);
j11 = inv_Je(1,1);              j12 = inv_Je(1,2);
j21 = inv_Je(2,1);              j22 = inv_Je(2,2);    


N= sym(zeros(3,9)); 
recorrido=1:3:12;
for i = 1:3
    N(:,recorrido(i):recorrido(i)+2) = diag([Nforma(i), Nforma(i),Nforma(i)]);
end   


%% Se calcula Bb_beta (ecuacion 12)
Bb_beta = sym(zeros(3,9));
for i = 1:3                
    dNi_dx = j11*dN_dxi(i) + j12*dN_deta(i); % = ai
    dNi_dy = j21*dN_dxi(i) + j22*dN_deta(i); % = bi               
    Bb_beta(:,recorrido(i):recorrido(i)+2) = [ 0    dNi_dx         0
                                               0         0    dNi_dy
                                              0    dNi_dy    dNi_dx ];
end

%% Se calcula Bb_dbeta (ecuacion 13)
