    dPk_dy = j21*dP_dxi(k) + j22*dP_deta(k);
    Bb_dbeta(:,k) = [ dPk_dx*Ck(k)
                      dPk_dy*Sk(k)
                      dPk_dy*Ck(k) + dPk_dx*Sk(k) ];
end

